import React from 'react';

// --- SVG Icons for Contact Details ---
const MailIcon = ({ className }) => (
  <svg className={className} fill="none" stroke="currentColor" viewBox="0 0 24 24">
    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3 8l7.89 5.26a2 2 0 002.22 0L21 8M5 19h14a2 2 0 002-2V7a2 2 0 00-2-2H5a2 2 0 00-2 2v10a2 2 0 002 2z" />
  </svg>
);

const GlobeIcon = ({ className }) => (
  <svg className={className} fill="none" stroke="currentColor" viewBox="0 0 24 24">
    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M21 12a9 9 0 01-9 9m9-9a9 9 0 00-9-9m9 9H3m9 9a9 9 0 01-9-9m9 9V3m0 18a9 9 0 009-9m-9 9a9 9 0 00-9-9" />
  </svg>
);

const LocationIcon = ({ className }) => (
  <svg className={className} fill="none" stroke="currentColor" viewBox="0 0 24 24">
    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M17.657 16.657L13.414 20.9a1.998 1.998 0 01-2.827 0l-4.244-4.243a8 8 0 1111.314 0z" />
    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M15 11a3 3 0 11-6 0 3 3 0 016 0z" />
  </svg>
);

const PhoneIcon = ({ className }) => (
  <svg className={className} fill="none" stroke="currentColor" viewBox="0 0 24 24">
    <path strokeLinecap="round" strokeLinejoin="round" strokeWidth={2} d="M3 5a2 2 0 012-2h3.28a1 1 0 01.948.684l1.498 4.493a1 1 0 01-.502 1.21l-2.257 1.13a11.042 11.042 0 005.516 5.516l1.13-2.257a1 1 0 011.21-.502l4.493 1.498a1 1 0 01.684.949V19a2 2 0 01-2 2h-1C9.716 21 3 14.284 3 6V5z" />
  </svg>
);

// --- SVG for Decorative Cloud Shapes ---
const CloudShape = ({ className }) => (
  <svg className={className} viewBox="0 0 140 60" fill="currentColor" xmlns="http://www.w3.org/2000/svg">
    <path d="M113.5 60C128.136 60 140 46.5685 140 30C140 13.4315 128.136 0 113.5 0H26.5C11.8645 0 0 13.4315 0 30C0 46.5685 11.8645 60 26.5 60H113.5Z" />
    <circle cx="25" cy="20" r="20" />
    <circle cx="60" cy="15" r="15" />
    <circle cx="95" cy="25" r="25" />
    <circle cx="125"cy="30" r="18" />
  </svg>
);

const Footer = () => {
  const contactInfo = [
    { icon: MailIcon, text: 'hello@reallygreatsite.com' },
    { icon: GlobeIcon, text: 'www.reallygreatsite.com' },
    { icon: LocationIcon, text: '123 Anywhere St., Any City, ST 12345' },
    { icon: PhoneIcon, text: '(123) 456-7890' },
  ];

  return (
    <footer className="bg-[#FDF8F0] relative w-full py-16 px-8 overflow-hidden font-sans">
      {/* Decorative Cloud Shapes */}
      <CloudShape className="absolute top-0 left-0 w-48 h-auto text-[#A7E0E0] opacity-80 -translate-x-10 -translate-y-4" />
      <CloudShape className="absolute bottom-0 right-0 w-48 h-auto text-[#A7E0E0] opacity-80 translate-x-10 translate-y-4" />

      {/* Main Content */}
      <div className="relative z-10 flex flex-col md:flex-row items-center justify-center gap-12">
        {/* Profile Picture with Scalloped Border */}
        <div className="relative w-40 h-40">
          <div className="absolute inset-0 bg-[#72C6C5] rounded-full" style={{ clipPath: 'url(#scalloped-edge)' }}></div>
          <img
            src="https://i.pinimg.com/564x/e8/dc/18/e8dc18e3a2b7256553856b3258525e86.jpg" // Replace with your image URL
            alt="Sebastian Bennet"
            className="absolute inset-2.5 w-[140px] h-[140px] object-cover rounded-full"
          />
        </div>

        {/* Name and Contact Details */}
        <div className="flex flex-col items-start">
          <h2 className="text-4xl font-bold text-[#4D9A9A] tracking-widest mb-6" style={{ fontFamily: "'Montserrat', sans-serif" }}>
            SEBASTIAN BENNET
          </h2>
          <div className="space-y-3">
            {contactInfo.map((item, index) => {
              const Icon = item.icon;
              return (
                <div key={index} className="flex items-center gap-4">
                  <Icon className="w-6 h-6 text-[#E4B56B]" />
                  <p className="text-[#D3A250] font-medium">{item.text}</p>
                </div>
              );
            })}
          </div>
        </div>
      </div>

      {/* SVG Definition for Scalloped Clip-Path */}
      <svg width="0" height="0">
        <defs>
          <clipPath id="scalloped-edge" clipPathUnits="objectBoundingBox">
            <path d="M0.5,0 C0.223,0,0,0.223,0,0.5 C0,0.777,0.223,1,0.5,1 C0.777,1,1,0.777,1,0.5 C1,0.223,0.777,0,0.5,0 M0.5,0.025 C0.762,0.025,0.975,0.238,0.975,0.5 C0.975,0.762,0.762,0.975,0.5,0.975 C0.238,0.975,0.025,0.762,0.025,0.5 C0.025,0.238,0.238,0.025,0.5,0.025 M0.5,0 A0.5,0.5,0,0,1,0.5,1 A0.5,0.5,0,0,1,0.5,0 M0.5,0.05 A0.45,0.45,0,0,0,0.5,0.95 A0.45,0.45,0,0,0,0.5,0.05 M0.5,0.1 A0.4,0.4,0,0,1,0.5,0.9 A0.4,0.4,0,0,1,0.5,0.1 M0.5,0.15 A0.35,0.35,0,0,0,0.5,0.85 A0.35,0.35,0,0,0,0.5,0.15 M0.5,0.2 A0.3,0.3,0,0,1,0.5,0.8 A0.3,0.3,0,0,1,0.5,0.2 M0.5,0.25 A0.25,0.25,0,0,0,0.5,0.75 A0.25,0.25,0,0,0,0.5,0.25 M0.5,0.3 A0.2,0.2,0,0,1,0.5,0.7 A0.2,0.2,0,0,1,0.5,0.3 M0.5,0.35 A0.15,0.15,0,0,0,0.5,0.65 A0.15,0.15,0,0,0,0.5,0.35 M0.5,0.4 A0.1,0.1,0,0,1,0.5,0.6 A0.1,0.1,0,0,1,0.5,0.4 M0.5,0.45 A0.05,0.05,0,0,0,0.5,0.55 A0.05,0.05,0,0,0,0.5,0.45" />
          </clipPath>
        </defs>
      </svg>
    </footer>
  );
};

export default Footer;
